const ListFile = ({
  files, handleSearch, addRequest, checkAdmin, checkLetter,
  handleSearchFile,
}) => {
  const [deletingFile, setDeletingFile] = useState();

  const openDeleteDialog = useCallback((_, file) => {
    setDeletingFile(file);
    handleSearchFile();
  }, [handleSearchFile]);

  const onClose = useCallback(() => {
    setDeletingFile(null);
  }, []);

  const [duplicatingFile, setDuplicatingFile] = useState();

  const openDuplicateDialog = useCallback((_, file) => {
    setDuplicatingFile(file);
  }, []);

  const onCloseDuplicateDialog = useCallback(() => {
    setDuplicatingFile(null);
  }, []);

  return (
    <>
      <DeleteFileDialog handleSearchFile={handleSearchFile} file={deletingFile} isOpen={!!deletingFile} onClose={onClose} />
      <DuplicateFileDialog handleSearchFile={handleSearchFile} file={duplicatingFile} isOpen={!!duplicatingFile} onClose={onCloseDuplicateDialog} />
      <MaterialTable
        title="Expedientes"
        columns={columnsFile}
        data={files}
        options={{
          search: false,
          paging: false,
        }}

        actions={[
          {
            icon: 'search',
            tooltip: 'buscador solicitud',
            onClick: (event, rowData) => {
              handleSearch(rowData.id, rowData.fileNumber);
            },
          },
          {
            icon: 'add_circle',
            hidden: !checkAdmin,
            tooltip: 'agregar solicitud',
            onClick: (event, rowData) => {
              addRequest(rowData.fileNumber);
            },
          },
          (rowData) => ({
            icon: 'file_copy',
            hidden: !checkAdmin,
            tooltip: 'Duplicar expediente',
            onClick: openDuplicateDialog,
          }),
          (rowData) => ({
            icon: 'send',
            hidden: !checkLetter(rowData.status),
            tooltip: 'Crear carta',
            onClick: () => generateLetter(rowData),
          }),
          (rowData) => ({
            icon: 'delete',
            tooltip: 'Borrar expediente',
            onClick: openDeleteDialog,
            hidden: !checkAdmin,
          }),
        ]}
      />
    </>
  );
};

export default ListFile;
